        "\n",
        "  x = np.expand_dims(x, axis=0)\n",
        "\n",
        "  x /= 255.\n",
        "\n",
        "  images = np.vstack([x])\n",
        "\n",
        "  classes = model.predict(images, batch_size=10)\n",
